import { useParams } from "react-router-dom";
import { Patient } from "../../types";
import patientService from "../../services/patients";
import { useEffect, useState } from "react";
import { Male , Female, Transgender } from '@mui/icons-material';

const PatientToShow = () => {
  const id = useParams().id?.toString() || null;
  const [patient, setPatient] = useState<Patient | null>(null);

  useEffect(() => {
    const fetchPatient = async () => {
      const fetchedPatient = await patientService.getPatient(id);
      setPatient(fetchedPatient);
    };
    fetchPatient();
  }, [id]);

  return (
    <div>
      {patient && 
      <>
      <h2>{patient.name} { patient.gender === "male" 
      ? <Male />
      : patient.gender === "female"
      ? < Female />
      : < Transgender />
    }</h2>
      <p>ssn: {patient.ssn}</p>
      <p>occupation: {patient.occupation}</p>
      </>
      }
      <h2>Entries</h2>
      { patient && patient.entries && patient.entries.map(entry => {
        switch (entry.type) {
          case "Hospital":
            return <div>{entry.date} {entry.description}<br />{entry.diagnosisCodes?.map(diagnose => { return <li>diagnose</li> })}</div>;
            case "OccupationalHealthcare":
            return <div>{entry.date} {entry.description}<br />{entry.diagnosisCodes?.map(diagnose => { return diagnose })}</div>;
            case "HealthCheck":
            return <div>{entry.date} {entry.description}<br />{entry.diagnosisCodes?.map(diagnose => { return diagnose })}</div>;
          default:
            return null;
        }

    })}
    </div>
  );
};

export default PatientToShow;
